import styled from "styled-components";

const FilledBar = styled.div.attrs(({ value }) => ({
  style: {
    width: `calc(${value * 3.9}px)`
  }
}))`
  top: 14px;
  left: 0;
  position: absolute;
  background-color: #03a9f3;
  border-radius: 4px;
  height: 4px;
`;

export default FilledBar;
